import React, { useState } from 'react';
import './skills.scss';
import AcUnitIcon from '@mui/icons-material/AcUnit';
import BuildCircleIcon from '@mui/icons-material/BuildCircle';
import ComputerIcon from '@mui/icons-material/Computer';
import AndroidIcon from '@mui/icons-material/Android';

const Skills = () => {
    const [expanded, setExpanded] = useState(false);
    const [hoveredSkill, setHoveredSkill] = useState('');

    const handleSkillClick = () => {
        setExpanded(!expanded);
    };

    const handleMouseEnter = (skill) => {
        setHoveredSkill(skill);
    };

    const handleMouseLeave = () => {
        setHoveredSkill('');
    };

    return (
        <div className='skills'>
            <div className="center">
                <button 
                    className={`skill-circle ${expanded ? 'expanded' : ''}`} 
                    onClick={handleSkillClick} 
                    aria-expanded={expanded}
                    aria-label="Toggle Skills"
                >
                    SKILLS
                </button>
                {expanded && (
                    <div className="divisions">
                        <div 
                            className="division" 
                            onMouseEnter={() => handleMouseEnter('frontend')} 
                            onMouseLeave={handleMouseLeave}
                            aria-label="Front-end Skills"
                        >
                            <ComputerIcon />
                            <div>
                                <p className='fs'>Front-end Skills</p>
                                {hoveredSkill === 'frontend' && (
                                    <div className="hover">
                                        <h1>Front-end Development Skills</h1>
                                        <ul>
                                            <li>React js</li>
                                            <li>HTML5</li>
                                            <li>CSS3</li>
                                            <li>JavaScript (Including Ajax, Redux)</li>
                                        </ul>
                                    </div>
                                )}
                            </div>
                        </div>
                        <div 
                            className="division" 
                            onMouseEnter={() => handleMouseEnter('backend')} 
                            onMouseLeave={handleMouseLeave}
                            aria-label="Back-end Skills"
                        >
                            <BuildCircleIcon />
                            <p className='bs'>Back-end Skills</p>
                            {hoveredSkill === 'backend' && (
                                <div className="hover">
                                    <h1>Back-end Development Skills</h1>
                                    <ul>
                                        <li>Node.js</li>
                                        <li>Python</li>
                                        <li>C</li>
                                        <li>Cpp</li>
                                        <li>PHP</li>
                                        <li>Java</li>
                                    </ul>
                                </div>
                            )}
                        </div>
                        <div 
                            className="division" 
                            onMouseEnter={() => handleMouseEnter('softskills')} 
                            onMouseLeave={handleMouseLeave}
                            aria-label="Soft Skills"
                        >
                            <AcUnitIcon />
                            <p className='ss'>Soft Skills</p>
                            {hoveredSkill === 'softskills' && (
                                <div className="hover">
                                    <h1>Soft Skills</h1>
                                    <ul>
                                        <li>Effective Communication</li>
                                        <li>Analytical Thinking</li>
                                        <li>Team Collaboration</li>
                                        <li>Adaptability</li>
                                        <li>Problem-Solving</li>
                                    </ul>
                                </div>
                            )}
                        </div>
                        <div 
                            className="division" 
                            onMouseEnter={() => handleMouseEnter('aiothers')} 
                            onMouseLeave={handleMouseLeave}
                            aria-label="AI & Other Skills"
                        >
                            <AndroidIcon />
                            <p className='as'>AI & Other Skills</p>
                            {hoveredSkill === 'aiothers' && (
                                <div className="hover">
                                    <h1>AI Development Skills</h1>
                                    <ul>
                                        <li>Python</li>
                                        <li>Machine Learning</li>
                                        <li>Keras</li>
                                        <li>TensorFlow</li>
                                        <li>Pandas</li>
                                        <li>Data Analysis</li>
                                    </ul>
                                    <h1>Other Skills</h1>
                                    <ul>
                                        <li>Version control: Git And GitHub</li>
                                        <li>Database Management: MySQL & MongoDB</li>
                                    </ul>
                                </div>
                            )}
                        </div>
                    </div>
                )}
            </div>
        </div>
    );
}

export default Skills;
